import React from "react";
import Logo from "../Images/Logo.svg";
import "./Navbar.css";
import {Links} from "../data";

import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import Col from "react-bootstrap/Col";
import Nav from "react-bootstrap/Nav";
import Button from "react-bootstrap/Button";

const NavbarSec = () => {
  return (
    <Container fluid>
      <Navbar sticky='top' className='py-4 px-5' bg='light' variant='light'>
        <Col md={3}>
          <Navbar.Brand to='/'>
            <img src={Logo} alt='Meeco' width={200} />
          </Navbar.Brand>
        </Col>

        <Col md={6}>
          <div className='collapse navbar-collapse justify-content-center'>
            <ul className='navbar-nav text-center'>
              {Links.map(({name, path}, index) => {
                return (
                  <li className='nav-item px-2' key={index}>
                    <Nav.Link className='nav-link' href={path}>
                      {name}
                    </Nav.Link>
                  </li>
                );
              })}
            </ul>
          </div>
        </Col>

        <Col md={3}>
          <Nav className='justify-content-end'>
            <Button
              variant='outiline-color-light'
              className=' mr-4'
              type='submit'
              onClick={"submit"}
            >
              <i class='fa-sharp fa-solid fa-magnifying-glass'></i>
            </Button>

            <Button className='btn-mycolor'>Get in Touch</Button>
          </Nav>
        </Col>
      </Navbar>
    </Container>
  );
};
export default NavbarSec;
